export class Choice {
  constructor(
    public choiceID: string,
    public description: string,
    public optionOne: string,
    public optionTwo: string,
    public base64ImageOne: string,
    public base64ImageTwo: string,
    public accepted: boolean,
    public friendOnly: boolean,
    public timeStamp?: number,
    public optionOneScore?: number,
    public optionTwoScore?: number
  ) {
    if(!optionOneScore){
      this.optionOneScore = 0;
    }
    if(!optionTwoScore){
      this.optionTwoScore = 0;
    }
    if(!timeStamp){
      this.timeStamp = Date.now();
    }
    // if(!base64ImageOne){
    //   this.base64ImageOne = "data:image/jpeg;base64,"
    // }
    // if(!base64ImageTwo){
    //   this.base64ImageTwo = "data:image/jpeg;base64,"
    // }

  }
}
